INSERT INTO `news` (`n_id`, `n_active`, `n_title`, `n_image`, `n_nc_id`, `n_description`, `n_content`, `n_time`, `n_last_edit`) VALUES (1,1,'Hướng dẫn sử dụng Tool Liên Minh Huyền Thoại','https://upanh123.com/image/ossq',1,'<p>a</p>\n','<p>- <strong>ASS TƯỚNG</strong> : Là các ass liên quan đến tướng, chơi con nào thì chọn con đó.<br>\n-<strong> ASS TIỆN ÍCH </strong>: Là các loại hỗ trợ như auto né skill, hiện mắt , mod skin, ...<br>\n-<strong> Libraries </strong>: Mục này để nguyên.</p>\n\n<p>+ Nhấn phím <strong>F5</strong> trong game để chạy lại tất cả các assemblies (Trường hợp các ass chưa kịp load mà đã vào. game)</p>\n\n<p>+ Giữ phím <strong>Shift</strong> Hoặc<strong> F9</strong> trong game để mở menu chỉnh tool.</p>\n\n<p>+ .Nhấn phím <strong>K</strong> để bật/ Tắt chức năng \"Né skill\" trong game ( combat to thì nên bật, bình thường nên tắt đi thì ít bị nghi ngờ )</p>\n\n<p> </p>\n\n<p><strong>+ Combo<em> (Nút cách)</em></strong> (ấn giữ phím    ) – <em><strong>Xả combo kĩ năng hoặc bắn thườn</strong></em>g vào  tướng địch khi trong tầm bắn.<br>\n<strong>+ Mixed (phím C)</strong> (ấn giữ phím)         – Sẽ <strong><em>Farm last hit và rỉa máu</em></strong> địch bằng kĩ năng hoặc bắn thường.<br>\n<strong>+ Last Hit (phím X)</strong> (ấn giữ phím)      – Sẽ <em><strong>Farm last hit</strong></em> lính trong tầm bắn của tướng.<br>\n<strong>+ Lane Clear (phím V)</strong> (ấn giữ phím) – Sẽ<strong><em> dọn lính nhanh bằng cách xả skill</em></strong> để dọn lính.<br>\nĐể có thể đổi phím nóng theo ý bạn:  vào game ấn<strong> Shift</strong> ->> ấn <strong>tên tướng</strong> ->> ấn <strong>orbwaking</strong> ->> rồi <strong>click chuột trá</strong>i vào tính năng bạn muốn đổi rồi ấn phím mình muốn đổi .</p>\n',1477986557,1477986947);
